Tommy, die worstelde met zijn traumatische ontmoeting met de gemaskerde moordenaar ChromeSkull, is nu verdwenen dankzij de maniakale Preston, een mysterieuze man met een sinistere verbinding met ChromeSkull. Intussen heeft de moordenaar zijn zinnen gezet op een nieuw meisje, Jess. Nadat zij is verdwenen moet detective King beginnen aan een race tegen de klok om haar en Tommy te vinden voordat het te laat is, en proberen een einde te maken van de dodelijke praktijken van ChromeSkull.[/center]

